【新型 コペン LA400K　メッキ センター ピラー ガーニッシュ】 
<br /> 
<br /> 
<br />DAIHATSU 
<br />COPEN　LA400K専用　メッキ　センター　ピラーガーニッシュ
<br />純正のセンターピラー部分をブラックからメッキに取り換えるドレスアップパーツ 
<br />センターピラーの三角部をクロームメッキに変更するだけでシックなお洒落が味わえます 
<br />左右セット・取り付け簡単 
<br />MADE IN JAPAN 
<br />※メッキ処理特有のゴミカミ、小傷等がある場合がございます。
<br />予めご了承をお願いいたします。
