アンティーク感が漂うアイアンピック！<br>
<br>
お庭のアクセントにピッタリ！！<br>
<br>
プレート部分が可動式のギミックのため、風等でゆらゆらと動きます。<br>
<br>
インテリアやガーデニング・観葉植物が際立ちます！<br>
<br>
お店のディスプレイとしてもGood!!<br>
<br>
アンティーク調のデザインのため、色ムラ等があります。<br>
※人気商品の為、欠品の際は入荷までにお時間を頂く場合がございます。<br>
在庫があるうちに、お早目のご注文をお勧めいたします！！<br>

<br>
